import React, { Suspense, useState } from 'react';
import { Canvas } from '@react-three/fiber';
import { OrbitControls, useGLTF, Environment, Html } from '@react-three/drei';
import * as THREE from 'three';

// Loading component
function LoadingSpinner() {
  return (
    <Html center>
      <div style={{
        color: '#ffffff',
        fontSize: '18px',
        textAlign: 'center'
      }}>
        <div style={{
          border: '4px solid #f3f3f3',
          borderTop: '4px solid #3498db',
          borderRadius: '50%',
          width: '40px',
          height: '40px',
          animation: 'spin 1s linear infinite',
          margin: '0 auto 10px'
        }}></div>
        Loading 3D Model...
      </div>
    </Html>
  );
}

// 3D Model Component
function Model({ url }) {
  const { scene } = useGLTF(url);

  // Auto-fit model to scene
  React.useEffect(() => {
    if (scene && scene.children.length > 0) {
      console.log('Model loaded:', scene);

      // Clone scene to avoid modifying original
      const modelClone = scene.clone();

      // Center and scale model
      const box = new THREE.Box3().setFromObject(modelClone);
      const center = box.getCenter(new THREE.Vector3());
      const size = box.getSize(new THREE.Vector3());

      console.log('Model size:', size);
      console.log('Model center:', center);

      // Center the model
      modelClone.position.sub(center);

      // Scale to fit
      const maxDim = Math.max(size.x, size.y, size.z);
      const scale = 200 / maxDim;
      console.log('Applied scale:', scale);
      modelClone.scale.setScalar(scale);

      // Replace scene children with scaled model
      scene.clear();
      scene.add(modelClone);
    }
  }, [scene]);

  return <primitive object={scene} />;
}

export default function App() {
  const [error, setError] = useState(null);
  const modelUrl = '/assets/model.glb';

  return (
    <div style={{
      width: '100vw',
      height: '100vh',
      margin: 0,
      padding: 0,
      fontFamily: 'Arial, sans-serif',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)'
    }}>
      {/* Header */}
      <div style={{
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        zIndex: 100,
        padding: '20px',
        background: 'rgba(0,0,0,0.1)',
        backdropFilter: 'blur(10px)'
      }}>
        <h1 style={{
          color: 'white',
          margin: 0,
          fontSize: '24px'
        }}>
          3D Model Viewer
        </h1>
      </div>

      {/* 3D Canvas */}
      <Canvas
        shadows
        camera={{ position: [0, 0, 50], fov: 75 }}
        style={{ width: '100%', height: '100%' }}
        onError={() => setError('Failed to load 3D model')}
      >
        {/* Lighting */}
        <ambientLight intensity={0.4} />
        <directionalLight position={[10, 10, 5]} intensity={1.5} castShadow />
        <directionalLight position={[-10, -10, -5]} intensity={0.8} />
        <pointLight position={[0, 10, 0]} intensity={0.5} />

        {/* Environment for reflections */}
        <Environment preset="warehouse" background={false} />

        {/* Model with loading fallback */}
        <Suspense fallback={<LoadingSpinner />}>
          {modelUrl && <Model url={modelUrl} />}
        </Suspense>

        {/* Camera controls */}
        <OrbitControls
          enablePan={true}
          enableZoom={true}
          enableRotate={true}
          autoRotate={false}
          autoRotateSpeed={0.5}
          dampingFactor={0.05}
          enableDamping={true}
          maxPolarAngle={Math.PI}
          minDistance={10}
          maxDistance={200}
        />
      </Canvas>

      {/* Error message */}
      {error && (
        <div style={{
          position: 'absolute',
          bottom: '20px',
          left: '20px',
          right: '20px',
          background: 'rgba(255,0,0,0.8)',
          color: 'white',
          padding: '15px',
          borderRadius: '4px',
          textAlign: 'center'
        }}>
          {error}
        </div>
      )}

      {/* Controls info */}
      <div style={{
        position: 'absolute',
        bottom: '20px',
        right: '20px',
        background: 'rgba(0,0,0,0.7)',
        color: 'white',
        padding: '10px',
        borderRadius: '4px',
        fontSize: '12px'
      }}>
        <div>🖱️ Click + Drag: Rotate</div>
        <div>🔍 Scroll: Zoom</div>
        <div>⌨️ Right Click + Drag: Pan</div>
      </div>

      {/* CSS Animation */}
      <style>{`
        @keyframes spin {
          0% { transform: rotate(0deg); }
          100% { transform: rotate(360deg); }
        }

        body {
          margin: 0;
          overflow: hidden;
        }
      `}</style>
    </div>
  );
}
